import React, { useState, useEffect } from "react";

export default function LightDetect({name, all, lights}) {

	function onToggle(name) {
		console.log(name);
	}

	console.log(name, all, lights);
	return (
    	<div key={name}>
		<p>{name}</p>
		<p>{lights.toString()}</p>
		<input
          		type='checkbox'
			onCheck={onToggle(name)}
        	/>
    	</div>
  	);
}
